function Collapse(props) {
    return (

        <div>
            <a class="btn btn-primary">
                    {props.linkTitle}
            </a>
                
            <div class="collapse" >
                <div class="card card-body">
                    {props.children}
                </div>
            </div>
        </div>
    );
}

export default Collapse;
